        if len(set(s)) == 1:
            return k
        if len(s) == 1:
            return k
        if len(s) % 2 == 1:
            return float('inf')
        m = (0 + len(s) - 1) // 2
        return min(snek(s[:m + 1], k + 1), snek(s[m + 1:], k + 2))
    if len(set(s)) == 1:
        return 0
    elif len(s) % 2 == 1:
        return -1
    else:
        ans = snek(s, 0)
        return ans if ans != float('inf') else -1

